import React from 'react';
import Buttons from './buttons';
import Options from './options';
import Maze from './maze';

function Navbar(){
    return (
      <div className = "navbar">
        <div className="title">
            
        </div>
        <div className="features">
          <Options/>
          <Maze/>
          <Buttons/>
        </div>
      </div>
    );
}
export default Navbar;
